<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        @page {
            size: a4;
            margin: 20px 10px 0px 10px;
        }

        body {
            margin: 0 auto;
            width: 1150px;
            font-family: SimSun, Microsoft YaHei, Serif;
        }

        .template-header,
        .template-body,
        .template-footer {
            width: 1150px;
        }

        .header {
            padding-top: 10px;
            padding-bottom: 20px;
            position: relative;
            overflow: hidden;
        }

        .header .has-seal {
            width: 200px;
            position: absolute;
            top: 0px;
            left: 488px;
        }

        .header-logo {
            display: inline-block;
            width: 175px;
            text-align: center;
        }

        .header-logo div:nth-child(1) img {
            display: block;
            width: 160px;
            padding-bottom: 10px;
            margin: 0 auto;
        }

        .header-logo div:nth-child(2) img {
            display: block;
            width: 160px;
            margin: 0 auto;
        }

        .header-logo div:nth-child(3) {
            text-align: center;
            width: 160px;
            margin: 0 auto;
        }

        .header-title {
            float: right;
            width: 780px;
            text-align: center;
        }

        .header-title div:nth-child(1) {
            font-size: 40px;
            text-align: center;
            letter-spacing: 5px;
            font-weight: bold;
        }

        .header-title div:nth-child(2) {
            font-size: 18px;
            text-align: center;
            padding-top: 10px;
        }

        .header-title div:nth-child(3) {
            font-size: 24px;
            text-align: center;
            padding-top: 10px;
            font-weight: bolder;
            letter-spacing: 2px;
        }

        .header-qr-code {
            float: right;
            text-align: center;
            width: 160px;
            text-align: center;
        }

        .header-qr-code .certified {
            font-size: 12px;
        }

        .header-qr-code-img {
            width: 115px;
            margin-bottom: 5px;
        }

        /* report personal info */
        .person-info {
            font-size: 20px;
            line-height: 28px;
            padding-top: 8px;
            padding-bottom: 10px;
            border-top: 1px solid black;
            border-bottom: 1px solid black;
        }

        .person-info-row div {
            display: inline-block;
            width: 32%;
            letter-spacing: 1px;
            line-height: 24px;
            height: 24x;
            vertical-align: middle;
        }

        /* report body */
        .bold-txt {
            font-weight: 600;
        }

        .fs16 {
            font-size: 16px;
            line-height: 22px;
        }

        .fs18 {
            font-size: 18px;
            line-height: 24px;
        }

        .fs21 {
            font-size: 21px;
            line-height: 30px;
        }

        .fs22 {
            font-size: 22px;
            line-height: 30px;
        }

        .padding10 {
            padding-top: 10px;
            padding-bottom: 10px;
        }

        .padding15 {
            padding-top: 15px;
            padding-bottom: 15px;
        }

        .padding20 {
            padding-top: 20px;
            padding-bottom: 20px;
        }

        .pt40 {
            padding-top: 40px;
        }

        .pl30 {
            padding-left: 30px;
        }

        .pl100 {
            padding-left: 100px;
        }

        .report-body {
            padding-top: 20px;
            font-size: 16px;
            line-height: 20px;
        }

        .detail-options {
            padding: 0 0 10px;
        }

        .detail-left {
            width: 49%;
            border-right: 1px solid #333;
            letter-spacing: 1px;
            display: inline-block;
        }

        .detail-right {
            display: inline-block;
            width: 50%;
            vertical-align: top;
            box-sizing: border-box;
            padding-left: 40px;
        }

        .bacterium-header {
            display: table;
            width: 100%;
        }

        .bacterium-header div {
            display: inline-block;
            vertical-align: middle;
            letter-spacing: 1px;
            line-height: 30px;
            height: 30x;
            width: 33%;
        }

        .bacterium-title {
            display: table;
            width: 100%;
            font-size: 20px;
            line-height: 28px;
        }

        .bacterium-title div {
            display: inline-block;
            vertical-align: middle;
            letter-spacing: 1px;
            line-height: 30px;
            height: 30x;
            width: 33%;
        }

        .microscopical {
            padding-bottom: 20px;
        }

        .microscopical-img img {
            width: 350px;
            height: 350px;
        }

        .microscopical-img img:nth-child(1) {
            margin-right: 20px;
        }

        .bottomAdvice {
            padding: 20px 0 0;
            line-height: 22px;
        }

        /* report footer */
        .bold-title {
            font-weight: 600;
            font-size: 18px;
        }

        .footer {
            font-size: 14px;
            padding: 20px 0;
            position: relative;
        }

        .seal {
            width: 180px;
            position: absolute;
            right: 10px;
            bottom: 0;
        }

        .footer-title {
            font-weight: 600;
            font-size: 18px;
        }

        .footer-address {
            line-height: 24px;
        }

        .footer-statement {
            margin: 15px 0 75px;
            font-size: 16px;
        }

        .footer-sign {
            font-size: 18px;
            line-height: 30px;
            border-top: 1px solid black;
            display: table;
            word-spacing: 1px;
            width: 100%;
        }

        .footer-sign span {
            display: inline-block;
            width: 33%;
        }

        .footer-sign span:nth-child(3) {
            text-align: right;
        }

        .footer-sign span img {
            height: 25px;
            position: relative;
            top: 7px;
        }

        .footer-sign .report-time {
            display: inline;
            font-weight: 400;
            letter-spacing: 2px;
        }

        .footer-address {
            letter-spacing: 2px;
            word-break: break-all;
        }

        .footer-address span:nth-child(2),
        .footer-address span:nth-child(4) {
            float: right;
        }

        .footer-address span:nth-child(2) {
            width: 220px;
        }
    </style>
</head>
